import React, { PureComponent } from 'react';
import ReactEcharts from 'echarts-for-react';
import "./Left.css";
import Top3 from "./Top3.js";


export default class HomeChartLeft extends PureComponent {
    constructor(props) {
        super(props);
        this.state = {};
    }
	
	
    render() {
        return (
			<div id="left">
				<div className="l1">
				</div>
				<div className="l2">
				</div>
				<div className="l3">
					<div className="title">游客实时数据</div>
					<Top3 class="a"></Top3>
				</div>
				<div className="l4">	
				</div>
			</div>
        );
    }
}
